import React from "react";
import { Link as ScrollLink } from "react-scroll";

const aboutData = {
  cvpath: "media/Nathan-Foss-SoftwareDev.pdf",
  image: "images/about.png",
  name: "Nathan Foss",
  location: "Austin, TX",
  email: "nathanfoss.dev@gmail.com",
  aboutMe:
    "I am Nathan Foss, web developer from London, United Kingdom. I have rich experience in web site design and building and customization, also I am good at wordpress.",
};

const contactData = {
  phone: ["+44 1632 960428"],
  email: ["hello@bako.com"],
  location: "West Palm Beach, 4669 Travis Street",
};

function About() {
  return (
    <div>
      <img src={aboutData.image} alt={aboutData.name} />
      <div className="row">
        <div className="col-md-3"></div>
        <div className="col-md-9">
          <h2 className="mt-4 mt-md-0 mb-4">Hello,</h2>
          <p className="mb-0">{aboutData.aboutMe}</p>
          <div className="row my-4">
            <div className="col-md-6">
              <p className="mb-2">
                Location:{" "}
                <span className="text-dark">{aboutData.location}</span>
              </p>
            </div>
            <div className="col-md-6 mt-2 mt-md-0 mt-sm-2">
              <p className="mb-0">
                Email: <span className="text-dark">{aboutData.email}</span>
              </p>
            </div>
          </div>
          <a href={aboutData.cvpath} className="btn btn-default mr-3">
            <i className="icon-cloud-download"></i>Download CV
          </a>
          <ScrollLink
            activeClass="active"
            to="section-contact"
            spy={true}
            smooth={true}
            duration={500}
            offset={50}
            className="btn btn-alt mt-2 mt-md-0 mt-xs-2"
          >
            <i className="icon-envelope"></i>Hire me
          </ScrollLink>
        </div>
      </div>
    </div>
  );
}

export default About;
